import React, { useEffect, useState } from 'react'
import { StyleSheet, Text, View } from 'react-native'
import { Vaga } from '../models/vaga'
import VagaApi from '../api/vagas';
import tailwind from 'tailwind-rn';

export default function VagaDetalhes() {
    const [vaga, setVaga] = useState<Vaga>(new Vaga());

    useEffect(() => {
        VagaApi.buscarPorId(9).then(data => setVaga(data))
    } , [])

    return (
        <View style={tailwind("m-2")}>
            <Text style={tailwind("text-center text-xl mt-4 mb-6")}>{vaga.titulo}</Text>
            <View>
                <View>
                    <Text>Descrição:</Text>
                    <Text>{vaga.descricao}</Text>
                </View>
                <View>
                    
                </View>

            </View>
        </View>
    )
}

const styles = StyleSheet.create({})
